import "./App.css";
import Navbar from "./navbar.js";
import cartCouch from "./Assets/cartCouch.png"; // couch image for cart page

function Cart() {
  return (
    <div>
      <header>
        <Navbar />
      </header>
      <body>
        <h3>Cart</h3>
        {/* left hand side of page */}
        <div className="cartLeft">
          <img
            className="cartImg"
            src={cartCouch}
            alt="Red couch with a bright blue Fluff Stuff pillow"
          ></img>
          {/* left hand product info */}
          <div className="cartItem">
            <h4 className="removeMarg">Couch Pillow</h4>
            <h5>$89</h5>
            <h6>Color: Cozy Denim</h6>
            <h6>Fill: Memory Foam</h6>
            <div className="cartQty">
              <button className="addSub">â€“</button>
              <input type="text" value="1" />
              <button className="addSub">+</button>
            </div>
            <div className="miniLink">Remove from cart</div>
          </div>
        </div>
        {/* right hand side of page -- text */}
        <button className="filledButton inactive">ADD TO CART</button>
      </body>
    </div>
  );
}

export default Cart;
